  input: TEXT,SA11A1,SA11A1.40508,"On 5/13/05 we received a contribution from Trevor
    Gray in the amount of $25,000 which was deposited into our federal account.  Ten
    thousand was reattributed to Trevor's spouse, Edna Gray, and five thousand was
    transferred to our non-federal account on 5/16/05.  Our non-federal account is
    allowed to accept unlimited contributions from individuals.  A letter was sent
    to Trevor and Edna Gray advising them of how their contribution was split into
    our accounts and to offer them a chance for a refund.  According to AO 2001-17,
    the Commission has deemed it sufficient to deposit checks exceeding the federal
    limit into our federal account and then to make a transfer to our non-federal
    account for the portion that exceeds the federal limit.  Therefore, year to date
    agreegate totals reported by Trevor Gray on our report is a reflection of the
    federal portion of the donor's contribution to date."
